import React from 'react';

import './sidebarSection.style.scss';
import {Link} from "react-router-dom";

const SidebarSection = () => {
    return <div className={'sidebarSection'}>
        <Link to={`/products/men/shirt`} className={'sidebarSection-item'}>SHIRTS</Link>
        <Link to={'/products/men/t-Shirt'} className={'sidebarSection-item'}>T-SHIRTS</Link>
        <Link to={'/products/men/trouser'} className={'sidebarSection-item'}>TROUSER</Link>
        <span className={'sidebarSection-item'}>SWEATSHIRTS</span>
        <span className={'sidebarSection-item'}>SUITS</span>
        <span className={'sidebarSection-item'}>JACKETS</span>
    </div>
};

export default SidebarSection;
